import React from 'react'

const Auth = props => {
    return (
        <div
            style={{
                flexGrow: 1,
                display: 'flex',
                justifyContent: 'center',
                alignItems: 'center',
            }}
        >
            <div>
                <div> Enter Password to access site</div>
            </div>
        </div>
    )
}

export default Auth
